import React from 'react'
import Nav_Item from '../Components/Nav_Item'
import Profile from '../Components/Profile'
import "../CSS/Left_Side_Bar.css"
import { IoHome } from "react-icons/io5";

function Left_Side_Bar() {

    var iconStyle = {color:'white',marginLeft:'10px',marginRight:'10px',height:'1rem'}

    return (
        <div className="left-side-bar">
            <Profile/>
            <hr></hr>
            <Nav_Item icon={<IoHome  style={iconStyle}/>} title={"Home"}/>
            <Nav_Item icon={<IoHome style={iconStyle}/>} title={"About"}/>
            <Nav_Item icon={<IoHome style={iconStyle}/>} title={"My Skills"}/>
            <Nav_Item icon={<IoHome style={iconStyle}/>} title={"Work"}/>
            <Nav_Item icon={<IoHome/>} title={"Contact"}/>  
        </div>
    )
}

export default Left_Side_Bar
